import Animate from "react-animate-x";
// import { bounceOut } from "eases";

import React, { Component } from "react";

export default class App extends Component {
  render() {
    return (
      <div>
        <Animate
          from={{
            x: 0,
            y: 0
          }}
          to={{
            x: 100,
            y: 150
          }}
          // easing={bounceOut}
        >
          {({ x, y }) => (
            <div style={{ transform: `translate(${x}px, ${y}px)` }}>
              Animating!
            </div>
          )}
        </Animate>
      </div>
    );
  }
}
